trailingComments.value:
*
 * 从剪贴板粘贴到页面
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<Object>}
 *
 * @example
 * libSQ.exec('paste', {
 *   params: {
 *     maxLimit: 50,
 *   },
 * }).then((info) => {
 *   alert(`[paste][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[paste][error] ${JSON.stringify(err, null, 2)}`);
 * });

